import { observer } from 'mobx-react-lite';
import React from 'react';
import '../PageTable.css';
import { Button, Nav } from 'react-bootstrap';
import { getPosition } from '../http/positionAPI';

const PageTable = observer (() => {

    const click = async () => {
        try {
            let data;

            data = await getPosition(name);
            
        } catch (e) {
            alert(e.responce.data.message);
        }
    }

    return (
        <div className="container-fluid">
        <div className="row">
            <div className="col-md-4 col-lg-3 navbar-container bg-light">
                <nav className="navbar navbar-expand-md navbar-light">
                    <h1 className="navbar-brand">Таблицы</h1>
                    <div className="collapse navbar-collapse" id="navbar">
                        <ul className="navbar-nav">
                            <li className="nav-item">
                            <Button variant={"outline-light"} onClick={() => click()} className='ml-auto'>Выйти</Button>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link" href="#link-2">Ссылка 2</a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link" href="#link-3">Ссылка 3</a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link" href="#link-4">Ссылка 4</a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link" href="#link-5">Ссылка 5</a>
                            </li>
                        </ul>
                    </div>
                </nav>
            </div>
            <div className="col-md-8 col-lg-9 content-container div_color">
                <h2 className="h3 text-center mt-5">Выберете таблицу</h2>
            </div>
        </div>
    </div>
    )
});

export default PageTable;
